import React from 'react';

const Pokemon = props => {
    return <div>
        <img src={props.imageUrl} alt = ''>
        </img>
        <h1>{props.pokemonTitle}</h1>
        <ul>
        {props.types.map((types, id) =>{
                return <li key={id}>
                    {types}
                </li>
            })}
        </ul>
    </div>
}

export default Pokemon;
